import React from "react";

const animation = () => {
  let animate = () => {
    let myIframe = document.getElementById("IFrameId").contentWindow;
    console.log("adkjfdljm");
    window.addEventListener("keydown", function (evt) {
      myIframe.postMessage(
        JSON.stringify({ type: "KeyboardEvent", key: evt.key })
      );
      console.log("Aaaa");
    });
  };

  return (
    <div className="ANOuterDiv">
      <iframe
        // src="https://my.spline.design/buildingsunsetcopy-a0755fe79ab59dc655f24e1c6b5575b4/"
        src="../../building_sunset_copy/index.html"
        frameborder="0"
        id="IFrameId"
        width="1000px"
        height="650px"
      ></iframe>
      <button onClick={animate}>Click</button>
    </div>
  );
};

export default animation;
